@mrsmadelindley yes yes yes. I’ve internalized toxic positivity so much that I have to actively tell myself “be sad” or else I immediately jump to “it’s okay!” Even though it isn’t. 

So I tell myself things like “I’m doing my best.”
“It’s okay to not be okay.”

@Leannebutsecret yep. Agreed. 

I can’t believe I was taught to think that having sex with multiple partners would be giving parts of myself away. and literally all it did was teach me what I liked, how to communicate, and how to be vulnerable. 

I can’t imagine having stayed a virgin

